import React, { Component } from "react";
import adi from "../images/adi.jpg";

class About extends Component {
  render() {
    return (
      <>
        <div>
          <h2>About</h2>
          <Image src={adi} />
        </div>

        <div>
          Hie i'm Aditya Barve ,Persuing B.tech from Medicaps University
          ,Indore.I'm Passionate abiot web developement.And I'm intrested in
          Reactjs. I' m in my 8th semester Now.
        </div>
      </>
    );
  }
}

export default About;
